pragma solidity ^0.8.24;

/**
 * @dev Interface of the ERC20 standard as defined in the EIP.
 */
interface IERC20 {
    function totalSupply() external view returns (uint256);

    function decimals() external view returns (uint8);

    function balanceOf(address account) external view returns (uint256);

    function transfer(
        address recipient,
        uint256 amount
    ) external payable returns (bool);

    // function allowance(
    //     address owner,
    //     address spender
    // ) external view returns (uint256);

    // function approve(address spender, uint256 amount) external returns (bool);

    // function transferFrom(
    //     address sender,
    //     address recipient,
    //     uint256 amount
    // ) external returns (bool);

    // function permit(
    //     address target,
    //     address spender,
    //     uint256 value,
    //     uint256 deadline,
    //     uint8 v,
    //     bytes32 r,
    //     bytes32 s
    // ) external;

    // function transferWithPermit(
    //     address target,
    //     address to,
    //     uint256 value,
    //     uint256 deadline,
    //     uint8 v,
    //     bytes32 r,
    //     bytes32 s
    // ) external returns (bool);

    event Transfer(
        address indexed from,
        address indexed to,
        uint256 tokenAmount
    );

    event Saled(address indexed from, uint256 tokenValue, uint256 value);

    event Bought(address indexed from, uint256 tokenValue, uint256 value);

    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );
}

contract mm314 is IERC20 {
    string public constant name = "MM314";
    string public constant symbol = "MM314";
    uint8 public immutable override decimals = 18;

    /// @dev Records amount of token owned by account.
    mapping(address => uint256) public override balanceOf;
    uint256 private _totalSupply;
    // uint256 private balanceOfPool;

    // 对应 主币价值
    uint256 private mainValue;

    // configurable delay for timelock functions
    uint public constant transferDelay = 60; // seconds

    // set of minters, can be this bridge or other bridges
    mapping(address => bool) public isMinter;

    address public immutable creator;

    constructor(uint256 _i_totalSupply, uint256 _creatorInitAmount) payable {
        require(msg.value > 0, "need supply main coin value.");
        require(
            _i_totalSupply >= 21000000,
            "need _i_totalSupply equal or more than 21000000"
        );
        require(
            _creatorInitAmount * 1000 <= _i_totalSupply,
            "init Amount of creator can't more than 0.1%"
        );

        creator = msg.sender;
        mainValue = msg.value;
        _totalSupply = _i_totalSupply;
        balanceOf[creator] = _creatorInitAmount;
        balanceOf[address(this)] = _totalSupply - _creatorInitAmount; // balanceOfPool;
    }

    /// @dev Returns the total supply of AnyswapV3ERC20 token as the ETH held in this contract.
    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOfPool() public view returns (uint256) {
        return balanceOf[address(this)];
    }

    function setBalanceOfPool(uint256 amount) private {
        balanceOf[address(this)] = amount;
    }

    function transfer(
        address to,
        uint256 tokenValue
    ) external payable override returns (bool) {
        require(to != address(0));
        uint256 balance = balanceOf[msg.sender];
        require(balance >= tokenValue, "transfer amount exceeds balance.");

        balanceOf[msg.sender] = balance - tokenValue;

        if (to == address(this)) {
            // 触发卖出操作.
            uint256 bp = balanceOfPool() + tokenValue;
            setBalanceOfPool(bp);
            uint256 obtainMoney = (mainValue * tokenValue) / bp;

            payable(address(msg.sender)).transfer(obtainMoney);

            emit Saled(msg.sender, tokenValue, msg.value);
            return true;
        }

        balanceOf[to] += tokenValue;
        emit Transfer(msg.sender, to, tokenValue);

        return true;
    }

    receive() external payable {
        require(msg.value > 0, "need more than zero.");

        // 触发买入操作
        mainValue += msg.value;
        uint256 bp = balanceOfPool();
        uint256 obtainTokenValue = (bp * msg.value) / mainValue;
        bp -= obtainTokenValue;
        setBalanceOfPool(bp);
        balanceOf[msg.sender] += obtainTokenValue;
        emit Bought(msg.sender, obtainTokenValue, msg.value);
    }
}

